                    <div id=""analysis-body"" class=""modal-body"">
                        <h6 class=""font-weight-semibold"">Коробочный червь</h6>
                        <p>Хлопковая совка (коробочный червь). Этот вредитель очень распространен на соевых полях. По внешнему виду бабочка имеет одно большое почковидное пятно посредине большого переднего крыла. Бабочка откладывает яйца на ранних стадиях сои. Тело червя темно-зеленое, так как он питается зелеными листьями, покрытыми мелкими воло");
                WriteLiteral(@"сками и пятнами, эти черви питаются сначала листьями, а затем цветочными почками.</p>
                        <hr>
                        <div class=""row"">
                            <div class=""col-8"">
                                <h6 class=""font-weight-semibold"">Биологические метод борьбы</h6>
                                <p>Установить 1 феромоновую ловушку на каждые 2 га соевой площади и при попадании 2-3 бабочек на 1 ловушку за ночь выпускать по 1 грамму на 1 га трихограммового яйцееда 3 раза через 4-5 дней против каждого поколения вредителя. 1:20 от бракона энтомофага против немолодых и взрослых личинок совки; 1:10; Против каждого поколения вредителя выпускать в соотношении 1:5 3 раза через 4-5 дней по схеме 10х10м.</p>
                            </div>
