                                </div>
                            </div>
                        </div>
                        <hr>

                        <h6 class=""font-weight-semibold"">Химический метод борьбы</h6>
                        <p>В среднем химическую обработку проводят при наличии более 8-10 коробочных червей на 100  кустов сои. При этом обработка должна проводиться в научно обоснованные сроки, то есть когда бабочки откладывают яйца и появляются маленькие молодые червячки. Это гарантия высокой производительности. Если в поле появились средневозрастные и старые личинки, гарантией получения высоких результатов является применение препаратов с активными веществами эмамектина бензоата или индоксакарба (сюррендер, эмамекс, проклайм, аваунт и др.).</p>

                        <hr>

                        <h6 class=""font-weight-semibold"">Агротехнические методы борьбы<");
                WriteLiteral(@"/h6>
                        <p>Своевременная и тщательная обработка почвы – одно из самых необходимых условий выращивания здоровых и устойчивых растений. Вспашка земли на глубину 30 см (а на засоренных полях 32-35 см) бороной или двухрядным плугом через равные промежутки времени является мощным средством уничтожения вредителей, семян сорняков и возбудителей болезней. Основной причиной глубокой вспашки в осенний период является уничтожение вредителей, которые в циклический период уходят в зимнюю спячку. Это также создает условия для вычесывания стеблей сорняков.</p>

